// Badge classes
func getBadgeClasses(variant string) string {
	switch variant {
	case "success":
		return "bg-green-50 text-green-700 ring-1 ring-green-600/20"
	case "warning":
		return "bg-yellow-50 text-yellow-700 ring-1 ring-yellow-600/20"
	case "error":
		return "bg-red-50 text-red-700 ring-1 ring-red-600/20"
	case "info":
		return "bg-blue-50 text-blue-700 ring-1 ring-blue-600/20"
	case "primary":
		return "bg-blue-50 text-blue-700 ring-1 ring-blue-600/20"
	case "secondary":
		return "bg-gray-50 text-gray-700 ring-1 ring-gray-600/20"
	default:
		return "bg-gray-50 text-gray-700 ring-1 ring-gray-600/20"
	}
}

// Helper function to get button text
func getButtonText(iconName, tooltip string) string {
	switch iconName {
	case "eye":
		return "Žiūrėti"
	case "file-text":
		return "Lapas"
	case "edit":
		return "Redaguoti"
	case "edit-3":
		return "Pakeitimai"
	case "check":
		return "Patvirtinti"
	case "x":
		return "Atmesti"
	case "plus":
		return "Pradėti"
	case "upload":
		return "Įkelti"
	case "user-plus":
		return "Paskirti"
	default:
		return tooltip
	}
}

// Button variant mapping
func getButtonVariant(variant string) button.Variant {
	switch variant {
	case "success":
		return button.VariantDefault
	case "error":
		return button.VariantDestructive
	case "warning":
		return button.VariantOutline
	case "primary":
		return button.VariantDefault
	case "ghost":
		return button.VariantGhost
	default:
		return button.VariantOutline
	}
}

